import React, { useState, useEffect } from 'react';
import susieImage from './assets/resources/susie.jpg';

const resourcesData = [
  { serviceType: 'End of Life Doula', keyword: 'End of Life Doula', company: 'Susie’s Senior Services', contact: 'susiemae1221@yahoo.com', photoUrl: susieImage },
  { serviceType: 'Dementia Practitioner & Resources', keyword: 'Memory Care', company: 'Susie’s Senior Services', contact: 'susiemae1221@yahoo.com', photoUrl: susieImage },
  { serviceType: 'Dementia Practitioner & Resources', keyword: 'Memory Care', company: 'Alzheimer\'s Tennessee, Inc', contact: 'https://www.alztennessee.org/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Wellness/Fitness/Nutrition Advising', keyword: 'Wellness Advising', company: 'Susie’s Senior Services', contact: 'susiemae1221@yahoo.com' , photoUrl: susieImage},
  { serviceType: 'Home Care/ Medical Care Management', keyword: 'Home Care', company: 'Arosa Middle TN | Middle Tennessee Care Management & Home Care', contact: 'https://arosacare.com/locations/middle-tennessee/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'In-Home Senior Activities', keyword: 'Home Activities', company: 'Senior Activities R Us', contact: 'https://www.seniorsactivitiesrus.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Hospice', keyword: 'Hospice', company: 'Aveanna Hospice', contact: 'https://www.aveanna.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Legal Counsel', keyword: 'Legal', company: 'Ashley Stearns, Trail, Coleman & Stearns, PLLC – Attorneys at Law', contact: 'https://trailstearns.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Care Advising & Placement Agent', keyword: 'Placement Advising', company: 'GRAMPS of Tennessee', contact: 'You Are Here!', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Medicaid Help', keyword: 'Medicaid Help', company: 'TN.gov', contact: 'TN.gov', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Veterans Aid', keyword: 'Veterans', company: 'Veterans Home Care', contact: 'https://veteranshomecare.com/vet-assist/zero-interest-loan/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'After Loss Services', keyword: 'After Loss Services', company: 'Sunny Care Services', contact: 'https://sunnycareservices.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Medical Housecalls', keyword: 'Medical Housecalls', company: 'Medical House Calls Tennessee', contact: 'https://medicalhousecallstn.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Senior/Medical “Taxi” Service', keyword: 'Concierge Transportation Services', company: 'Susie’s Senior Services', contact: 'susiemae1221@yahoo.com', photoUrl: susieImage },
  { serviceType: 'Real Estate', keyword: 'Real Estate', company: 'The Bedsole Group', contact: 'https://thebedsolegroup.com/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Medicare Specialist', keyword: 'Medicare Specialist', company: 'Acuity Health Advisors', contact: 'https://www.acuityhealthadvisors.com/health-insurance/', photoUrl: 'path/to/your/photo.jpg' },
  { serviceType: 'Financial Advising', keyword: 'Financial Advising', company: 'Mortgage South Reverse Mortgages', contact: 'https://www.mortgage-south.com/', photoUrl: 'path/to/your/photo.jpg' },
];

const ResourceList = () => {
  const [filter, setFilter] = useState('');
  const [filteredResources, setFilteredResources] = useState(resourcesData);

  const handleFilterChange = (event) => {
    const value = event.target.value;
    setFilter(value);
    if (value === '') {
      setFilteredResources(resourcesData);
    } else {
      setFilteredResources(resourcesData.filter(resource => resource.serviceType.includes(value)));
    }
  };

  return (
    <div className="p-5">
      <h1 className="text-2xl font-bold text-center mb-5">Senior Service Partners</h1>
      <div className="flex justify-center mb-5">
        <div className="w-full max-w-xs">
          <select
            id="service-filter"
            value={filter}
            onChange={handleFilterChange}
            className="block appearance-none w-full bg-gray-200 border border-gray-200 text-gray-700 py-3 px-4 pr-8 rounded leading-tight focus:outline-none focus:bg-white focus:border-yellow-500 text-center"
          >
            <option value="">All Services</option>
            {Array.from(new Set(resourcesData.map(item => item.serviceType))).map(serviceType => (
              <option key={serviceType} value={serviceType}>{serviceType}</option>
            ))}
          </select>
        </div>
      </div>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        {filteredResources.map((resource, index) => (
          <div key={index} className="p-5 bg-white rounded-lg shadow transition duration-300 hover:shadow-lg border-2 border-yellow-500">
            <img src={resource.photoUrl} alt={resource.company} className="w-full h-32 object-cover rounded" />
            <h2 className="text-xl font-semibold mt-3">{resource.serviceType}</h2>
            <p className="mt-3"><strong>Company:</strong> {resource.company}</p>
            <p className="mt-3">
              <strong>Contact:</strong> {resource.contact.startsWith('http') ? (
                <a href={resource.contact} target="_blank" rel="noopener noreferrer" className="text-blue-500 hover:text-blue-700">{resource.contact}</a>
              ) : (
                <span>{resource.contact}</span>
              )}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ResourceList;
